import React from "react";
import EmployersListItem from "../EmployersListItem/EmployersListItem";
import "./EmployersList.css"

function EmployerList (){
    return(
     <ul className="appList listGroup">
        <EmployersListItem name="Katy P." salary="1000"/>
        <EmployersListItem name="Alex W." salary="900"/>
        <EmployersListItem name="Sandra B." salary="2000" />
     </ul>
    )
}
export default EmployerList;
